* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}
body {
    overflow-x: hidden;
    object-fit: cover;
}
.carousel-container {
    width: 300vw;
    height: 125vh;
    position: absolute;
    top: 5vh;
    left: 0;
    z-index: -2;
    display: flex;
    .arrows {
        position: absolute;
        width: 32%;
        height: 100px;
        left:20px;
        top: 50vh;
        display: flex;
        z-index: 2;
        justify-content: space-between;
        color: white;
        font-size: 40px;
    }
    .carousel-slide {
        display: flex;
        width: 300vw;
        height:100%;
        flex: 1;
        
        .imgbox1 {
            display: flex;
            flex: 1;
            width: 100vw;
            img {
                display: flex;
                height:100%;
                flex: 1;
                object-fit: cover;
                filter: brightness(60%);
            }
        }
        .imgbox2 {
            width: 100vw;
            display: flex;
            flex: 1;
            height:100%;
            img {
                display: flex;
                flex: 1;
                height:100%;
                object-fit: cover;
            }
        }
        .imgbox3 {
            display: flex;
            width: 100vw;
            flex: 1;
            height:100%;
            img {
                display: flex;
                width: 100vw;
                height:100%;
                object-fit: cover;
                filter: brightness(40%);
            }
        }
    }
}
.sliderInfo {
    position:absolute;
    z-index: 1;
    top:40vh;
    left: 45px;
    width: 50%;
    height: 60vh;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
    .buttonSlider {
        width: 40%;
        height: 72px;
        .btn {
            width: 250px;
            height: 72px;
            border-radius: 50px;
            background: rgba(24, 23, 23, 0.911);
            display: flex;
                align-items: center;
                justify-self: center;
            span {
                color: rgb(224, 218, 218);
                font-size: 20px;
                margin-left: 30px;
                font-weight: bold;
            }
        }
    }
    .descriptionSlider {
        display: flex;
        width: 100%;
        height: 72px;
        align-items: center;
        flex-direction: column;
        span {
            display: flex;
            color: rgb(224, 218, 218);
            font-size: 24px;
        }
    }
    .sliderTitle {
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: flex-start;
        height: auto;
        font-size: 30px;
        h1 {
            color: rgb(224, 218, 218);
            span {
                color: orange;
            }
        }
    }
}
